import styled from 'styled-components';

export default styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    #top {
        margin-bottom: 20px;
    }
    #banner {
        background-color: #00334A;
        width: 100%;
        height: 10vh;
        display: flex;
        justify-content: center;
        align-items: center;
    }
    #banner-caption {
        color: white;
        font-size: 30px;
    }
`;
